import './App.css';
import {Todolist} from "./Todolist";


function App() {
    return (
        <div className="App">
            <Todolist title="What to learn"/>
            <Todolist title="Songs"/>
            <Todolist title="Books"/>

        </div>
    );
}

export default App;
